const RemoveDuplicates = () => {
  let hopArr = [];
  return (
    <div>
    {
      base?.ingredients?.hops.map((hop) => {
        hopArr.push(hop.name);
        let obj = {};
        for (let i of hopArr) {
          obj[i] = true;
        }
        let newHopArr = Object.keys(obj);
        newHopArr.map((hop) => {
          return <p>{ hop}</p>
        })
      })
    }


    </div>
  )
}

export default RemoveDuplicates
